import './cardProduto.scss'

export default function CardProduto(props){

    function exibir(imagem){
        if(!imagem){
            return '';
        }
    }

    return(
        <div className="cardprd">

            <img src={props.imagem} alt=""/>
            <h6> {props.nome} </h6>
            <h6> {props.preco} </h6>
        
        </div>
    )
}
